import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import Link from 'next/link'

export default class Header extends Component {
    render() {
        const navLinks = [
            {
                text: "ùñïùñîùñóùñôùñãùñîùñëùñéùñî",
                link: "/"
            },
            {
                text: "ùñíùñéùñòùñà",
                link: "/misc"
            },
            {
                text: "ùñëùñéùñãùñä",
                link: "/blog"
            },
            {
                text: "ùñÜùñáùñîùñöùñô",
                link: "/about"
            },
            {
                text: "ùñàùñîùñìùñôùñÜùñàùñô",
                link: "/contact"
            }
        ]
        return <div>
            <Navbar expand="lg" className="navbar-light bg-transparent mt-5">
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Container>
                    <h1 className="text-center font-weight-bold">ùñóùñäùñëùñëùñéùñîùñò</h1>
                </Container>
                <Navbar.Collapse id="basic-navbar-nav">
                    <ul className="navbar-nav">
                        {navLinks.map(navItem => {
                            return <li key={navItem.text} className="nav-item">
                                <Link href={navItem.link}>
                                    <a className="nav-link">{navItem.text}</a>
                                </Link>
                            </li>
                        })}
                    </ul>
                </Navbar.Collapse>
            </Navbar>
        </div >
    }
}
